import style from "./Authentication.module.css";

//import getInf from "./loginReq.js";

function Authentication() {
  let props = {
    login: "",
    password: "",
  };
  const updateInputPassword = (evt) => {
    props.password = evt.target.value;
  };
  const updateInputLogin = (evt) => {
    props.login = evt.target.value;
  };
  return (
    <div className={style.container}>
      <div>
        <div className={style.login_container}>
          <div className={style.input}>
            <div>
              <div>Login</div>
              <input
                onChange={(evt) => {
                  updateInputLogin(evt);
                }}
                type="text"
              />
            </div>
            <div>
              <div>Password</div>
              <input
                onChange={(evt) => {
                  updateInputPassword(evt);
                }}
                type="text"
              />
            </div>
            <button onClick={console.log(props)} className={style.button}>
              Submit
            </button>
          </div>
        </div>

        <div></div>
      </div>
    </div>
  );
}
export default Authentication;
